        <div>
            <div>
                <div>
                    <label>Search</label>
                    <select name="pets" id="pet-select">
                        <option value="name">Name</option>
                        <option value="phone">phone</option>
                        <option value="email">Email</option>
                    </select>
                </div>
            </div>
            DisplayContacts
            <Table data={contacts} header={header} />
        </div>
    );
}

export default DisplayContacts;
